import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class CharacterService {

  constructor(private http: HttpClient) { }

  getAll(){
    return this.http.get('http://localhost:8080/v1/characters')
  }
  getCharacter(data: any){
    return this.http.get('http://localhost:8080/v1/characters/', data);
  }
}
